import React from "react";

const App = () => {
  return (
    <>
      <div className="main_div">
        <div className="centre_div">
          <br />
          <h1>ToDo List</h1>
          <br />
          <input type="text" placeholder="Add a Items" />
          <button>+</button>

          <ol>
            <li></li>
          </ol>
        </div>
      </div>
    </>
  );
};
export default App;
